import styles from './Proper.modules.scss'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';

function Proper(prop) {

    return (
        <div className={styles['search-list']}>
            <div className={styles['search-list_result']}>
                <FontAwesomeIcon className={styles['search-list__result__find']} icon={prop.icon} />
                <p className={styles['search-list_result__value']}>{prop.searchValue}</p>
            </div>
        </div>
    );
}

export default Proper;
